import React,{Component} from 'react'
import axios from 'axios'

class Post extends Component {
    state = {
        id:null
    }
    componentDidMount(){
        let id = this.props.match.params.post_id;
        axios.get(('https://jsonplaceholder.typicode.com/posts'))
        this.setState({
            id:id //or 'id'
        })
    }
    render(){
        return(
            <div className="container">
                <h4>
                    {this.state.id}
                </h4>
            </div>
        )
    }
}
export default Post
